import React from 'react';
import { IoHome } from 'react-icons/io5';
import styled from 'styled-components';

const GoHome = styled.a`
  position: fixed;
  top: 2%;
  left: 2%;
  width: 600px;
`;

function HomeButton() {
  return (
    <GoHome>
      <IoHome />
    </GoHome>
  );
}

export default HomeButton;
